import { useEffect } from "react";

export function DeleteNews(){
  useEffect(() => {
    // DELETE request using fetch with async/await
    async function deletePost() {
        await fetch('https://jsonplaceholder.typicode.com/posts/1', { method: 'DELETE' });
    }

    deletePost();
}, []);
}
